import logo from './logo.svg';
import './App.css';
import React from 'react';

  // FUNCTION ClassComponentGreeting

class ClassComponentGreeting extends React.Component {
  render() {
    return (<h2>Greeting from Class Component</h2>);
  }
}

  // FUNCTION APP
function App() {
  // START BUSINESS LOGIC

  const stringElement = "Hello String Element";
  const jsxElement = <h2>Hello JSX Syntax</h2>;
  const jsxVariableEl = <h2>JSX {stringElement}</h2>

  //JSX & FUNCTIONS

  const firstName = "Stjepan"
  const lastName = "Goreta"

  const jsxFunctionElement = <h2>Hello {fullName()}</h2>
  const jsxName = <h2>Hello {fullName2("Jasmin", "Causevic")}</h2>

  function fullName() {
    return firstName + " " + lastName;
  }

  function fullName2(fname, lname) {
    return fname + " " + lname;
  }

  // END OF BUSINESS LOGIC
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h2>{stringElement}</h2>
        {jsxElement}
        {jsxVariableEl}
        {jsxFunctionElement}
        {jsxName}
        <ClassComponentGreeting></ClassComponentGreeting>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
